import React, {Component} from 'react'
import './index.css'
import LeftMenu from './LeftMenu'
import HomePage from './HomePage'
import {Route} from "react-router";

class Main extends Component {

    render() {
        return (
            <main className={'main'}>
                <LeftMenu/>
                <Route exact path="/" component={HomePage}/>
            </main>
        );
    }
}

export default Main
